<head>

    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css">
    <title>Document</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link
        href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap"
        rel="stylesheet">
    <style>
        body {
            font-family: "Roboto", sans-serif;
        }

        @media screen {
            ul.productlist {
                margin-top: 0%;
                margin-bottom: 1%;
                width: 100%;
            }

            .navbar {
                height: 100%;
                block-size: fit-content;
                overflow-x: hidden;
                overflow-y: auto;


            }

            .map {
                overflow: auto;
                margin-top: 5%;
            }

            #svg1 {}

        }



        rect {
            opacity: 20%;
            transition: 0.2s;

            -moz-filter: grayscale(100%);
            -ms-filter: grayscale(100%);
            -o-filter: grayscale(100%);
            -webkit-filter: grayscale(100%);
            filter: grayscale(100%);
        }

        rect:hover {
            opacity: 100%;

            -moz-filter: grayscale(0%);
            -ms-filter: grayscale(0%);
            -o-filter: grayscale(0%);
            -webkit-filter: grayscale(0%);
            filter: none;

        }



        ul.productlist {

            list-style: none;
            font-size: medium;
            width: 100%;
            padding: 1vw;
        }

        li {
            margin: 10px;
            background-color: #4d4d4d;
            padding: 10px;
            border-radius: 12px;
            transition: 0.2s;
        }

        .clicked {
            background-color: #161616 !important;
            color: white !important;
        }

        .highlightgroup {
            opacity: 100%;
            -moz-filter: grayscale(0%);
            -ms-filter: grayscale(0%);
            -o-filter: grayscale(0%);
            -webkit-filter: grayscale(0%);
            filter: none;

        }

        .search {
            margin-top: 1vw;
            border-radius: 8px;

            -moz-filter: grayscale(0%);
            -ms-filter: grayscale(0%);
            -o-filter: grayscale(0%);
            -webkit-filter: grayscale(0%);
            filter: none;
        }
        svg{
            cursor: grab;
        }

        ul {
            margin-bottom: 10%;
        }
    </style>
    <script src="https://cdn.jsdelivr.net/npm/seamless-scroll-polyfill@2.3.4"></script>
    <script>

        function highlightgroup(groupname, classname) {
            let isSafari = /^((?!chrome|android).)*safari/i.test(navigator.userAgent)
            let li = document.getElementsByClassName(classname)
            let elements = document.getElementById(groupname).children
            for (let i = 0; i < elements.length; i++) {
                elements[i].classList.toggle('highlightgroup');
                if (isSafari == true) {
                    seamless.scrollIntoView(elements[i], {
                        behavior: "smooth",
                        block: "center",
                        inline: "center"
                    });
                }
                else {
                    elements[i].scrollIntoView({ behavior: "smooth", block: "center", inline: "center" })
                }
            }
            li[0].classList.toggle('clicked')
        }
        function myFunction() {
            // Declare variables
            let isSafari = /^((?!chrome|android).)*safari/i.test(navigator.userAgent)
            var input, filter, ul, li, a, i, txtValue;
            input = document.getElementById('myInput');
            filter = input.value.toUpperCase();
            allg = document.querySelectorAll('[id*="layer"] > rect')
            rect = allg
            // Loop through all list items, and hide those who don't match the search query
            for (i = 0; i < rect.length; i++) {
                txtValue = rect[i].getAttribute('inkscape:label') || "";
                if (txtValue.toUpperCase().indexOf(filter) > -1 && filter != '') {
                    rect[i].classList.add('highlightgroup');
                    if (isSafari == true) {
                        seamless.scrollIntoView(rect[i], {
                            behavior: "smooth",
                            block: "center",
                            inline: "center"
                        });
                    }
                    else {
                        rect[i].scrollIntoView({ behavior: "smooth", block: "center", inline: "center" })
                    }
                } else {
                    rect[i].classList.remove('highlightgroup');
                }
            }
        }
    </script>
</head>

<body>
    <div class="navbar">
        <ul class="productlist w3-bar w3-light-grey">
            <input class="search w3-bar-item w3-input w3-white w3-mobile" id="myInput" onkeyup="myFunction()"
                type="text" placeholder="Search..">
            <li class="cedar w3-bar-item w3-button " onclick="highlightgroup('layer1','cedar')">Cedar</li>
            <li class="FramingLumber w3-bar-item w3-button " onclick="highlightgroup('layer2','FramingLumber')">Framing
                Lumber</li>
            <li class="TreatedLumber w3-bar-item w3-button" onclick="highlightgroup('layer3','TreatedLumber')">Treated
                Lumber</li>
            <li class="Fascia w3-bar-item w3-button" onclick="highlightgroup('layer4','Fascia')">Fascia</li>
            <li class="Rebar w3-bar-item w3-button" onclick="highlightgroup('layer5','Rebar')">Rebar</li>
            <li class="Plywood w3-bar-item w3-button" onclick="highlightgroup('layer6','Plywood')">Plywood</li>
            <li class="Concrete w3-bar-item w3-button" onclick="highlightgroup('layer7','Concrete')">Concrete</li>
        </ul>
